import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function AddUser(props) {
  return (
    <button className="button" onClick={props.onClick}>
      Agregar
    </button>
  );
}

class AddTable extends React.Component {

  renderAddUser() {
    return (
      <AddUser
        value={"agregar"}
        onClick={() => this.props.onClick()}
      />
    );
  }

  render() {
    return (
      <div>
	<div>
	  <div className="info">
	    Nombre
	  </div>
	  <div>
	    <input name="Nombre"/>
	  </div>
	</div>
	<div>
	  <div className="info">
	    Apellido
	  </div>
	  <div>
	    <input name="Apellido"/>
	  </div>
	</div>
	<div>
	  <div className="info">
	    Origen
	  </div>
	  <div>
	    <input name="Origen"/>
	  </div>
	</div>
	<div>
	  <div className="info">
	    Destino
	  </div>
	  <div>
	    <input name="Destino"/>
	  </div>
	</div>
	<div>
          <div>
            {this.renderAddUser()}
	  </div>
        </div>
      </div>
    );
  }
}

class AeroLine extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      history: [
        {
          pasajeros: Array(0)
        }
      ],
      stepNumber: 0,
      xIsNext: true
    };
  }

  handleClick(i) {
    const history = this.state.history.slice(0, this.state.stepNumber + 1);
    const current = history[history.length - 1];
    const pasajeros = current.pasajeros.slice();
    if (history.stepNumber = 1 || pasajeros[i]) {
      return;
    }
    pasajeros[i] = this.state.xIsNext ? "X" : "O";
    this.setState({
      history: history.concat([
        {
          pasajeros: pasajeros
        }
      ]),
      stepNumber: history.length,
      xIsNext: !this.state.xIsNext
    });
  }

  jumpTo(step) {
    this.setState({
      stepNumber: step,
      xIsNext: (step % 2) === 0
    });
  }

  EditUser(step) {
    this.setState({
      stepNumber: step,
      xIsNext: (step % 2) === 0
    });
  }

  DeleteUser(step) {
    this.setState({
      stepNumber: step,
      xIsNext: (step % 2) === 0
    });
  }

  render() {
    const history = this.state.history;
    const current = history[this.state.stepNumber];

    const moves = history.map((step, move) => {
      const desc = move ?
        'Go to move #' + move :
        'Go to AeroLine start';
      return (
        <li key={move}>
	  <div>
	    <b>Nombre: {move} - </b>
	    <b>Nombre: {move} - </b>
	    <b>Nombre: {move} - </b>
	    <b>Nombre: {move} - </b>
	    <button onClick={() => this.jumpTo(move)}>Editar</button>
	    <button onClick={() => this.jumpTo(move)}>Eliminar</button>
	  </div>
        </li>
      );
    });

    let status;
    status = "Next player: " + (this.state.xIsNext ? "X" : "O");

    return (
      <div className="aeroline">
        <div className="aeroline-add">
          <AddTable
            squares={current.squares}
            onClick={i => this.handleClick(i)}
          />
        </div>
        <div className="aeroline-list">
          <div>{status}</div>
          <ol>{moves}</ol>
        </div>
      </div>
    );
  }
}

// ========================================

ReactDOM.render(<AeroLine />, document.getElementById("root"));
